              <CustomButton  title={'Zamów materiały'}/>
              </div>
              
          </div>
          <div class="bottom-title ">
              
          </div>
      </div>
      <div className="col-md-5">
      <Slider>

</Slider>

          
      </div>
    </div>
</div>

    );
}
